import styled from "styled-components";
import React from "react";

const Header = (props) => {
  return (
    <Nav>
      <Logo>
        <img src="/images/logo.svg" alt="Disney+" />
      </Logo>
    </Nav>
  );
};

const Nav = styled.nav`
  position: fixed;
  height: 70px;
  top: 0;
  right: 0;
  left: 0;
  background-color: #090b13;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  z-index: 3;
`;

export default Header;
